var headers=new Headers();headers.append("Content-Type","application/json");class WeSenderSDK{constructor(apiKey){this._url='http://apiwesender-dev.digitalfactory.co.ao/';this._apiKey=apiKey}async sendMessage({destine,message,hasSpecialCharacters=false}){const route='envio/apikey';const fullPath=this._url+route;const body={ApiKey:this._apiKey,Destino:destine,Mensagem:message,CEspecial:hasSpecialCharacters};try{const sendStreambleResponse=await fetch(fullPath,{method:'POST',body:JSON.stringify(body),headers:headers});const sendResponse=await sendStreambleResponse.json();return sendResponse}catch(e){throw e}}}